import React from 'react';

function Contact() {
    return (
        <div className='flex-items-center'>
            <div className='font-size: large'>
                <a href='https://github.com/JelloElephant'>GitHub Profile</a>
                <br />
                <a href='mailto:eik995@hotmail.com'>eik995@hotmail.com</a>
            </div>
        </div>
    )
}
export default Contact;
